INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("ヒヨリ", 155, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 0, "東山奈央", 2, 8, 27, "獣人族", 44, 16, "トゥインクルウィッシュ", "A", "人助け、応援", "人助けが大好き！　前向き格闘娘", 100101);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("ユイ", 158, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 0, "種田梨沙", 2, 4, 5, "ヒューマン", 47, 17, "トゥインクルウィッシュ", "O", "料理、人間観察", "戦闘のサポートが得意な、心優しい少女", 100201);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("レイ", 163, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 0, "早見沙織", 2, 1, 12, "魔族", 46, 18, "トゥインクルウィッシュ", "B", "読書、乗馬、お茶", "クールで何事にも真っ直ぐな剣士", 100301);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("ミソギ", 128, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", 0, "諸星すみれ", 5, 8, 10, "ヒューマン", 27, 9, "リトルリリカル", "O", "いたずら、探検", "探検好きのイタズラっ子", 100401);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("マツリ", 146, "？？？", 0, "下田麻美", 8, 11, 25, "獣人族", 40, 12, "王宮騎士団（NIGHTMARE）", "O", "ヒーローごっこ", "ヒーローに憧れる騎士見習いの少女", 100501);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("アカリ", 150, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", 0, "浅倉杏美", 7, 11, 22, "魔族", 42, 13, "悪魔偽王国軍（ディアボロス）", "O", "サックス", "甘え上手なみんなの人気者", 100601);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("ミヤコ", 130, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 0, "雨宮天", 7, 1, 23, "魔族", 32, 14, "悪魔偽王国軍（ディアボロス）", "B", "プリンを食べること", "プリン大好きゴースト娘", 100701);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("ユキ", 150, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", 0, "大空直美", 15, 10, 10, "エルフ", 40, 14, "ヴァイスフリューゲル　ランドソル支部", "AB", "鏡で自分を見ること", "ボクは誰よりも美しい", 100801);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("アンナ", 159, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", 0, "髙野麻美", 13, 7, 5, "魔族", 45, 17, "トワイライトキャラバン", "A", "小説執筆", "前世を信じる中二病患者、「疾風の冥姫」", 100901);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("マホ", 155, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 0, "内田真礼", 10, 9, 22, "獣人族", 42, 16, "自警団（カォン）", "O", "空想、ぬいぐるみ集め", "マホマホ王国のプリンセス", 101001);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("リノ", 156, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", 0, "阿澄佳奈", 3, 8, 25, "ヒューマン", 44, 15, "ラビリンス", "A", "お裁縫", "人懐っこくてマシンガントークな妹系少女", 101101);
