INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("ミサト", 165, "test", 0, "國府田マリ子", 6, 9, 5, "エルフ", 54, 21, "フォレスティエ", "O", "絵本作り", "母性溢れる優しいみんなの「ミサト先生」", 101501);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("スズナ", 167, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 0, "上坂すみれ", 14, 4, 10, "魔族", 48, 18, "ルーセント学院", "O", "ファッション", "天真爛漫で人気者のカリスマモデル", 101601);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("カオリ", 158, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", 0, "高森奈津美", 10, 7, 7, "獣人族", 53, 19, "自警団（カォン）", "A", "踊り、空手", "いつでも「なんくるないさ～」な天然娘", 101701);
