INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("ミミ", 117, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", 0, "日高里菜", 5, 4, 3, "獣人族", 21, 10, "リトルリリカル", "O", "かわいいもの集め", "お歌もにんじんも、ウサギさんも大好き♪", 102001);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("クルミ", 150, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 0, "植田佳奈", 9, 6, 9, "ヒューマン", 40, 12, "サレンディア救護院", "B", "観劇、おままごと", "泣き虫で臆病な守ってあげたい女の子", 102101);
