INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("スズメ", 154, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 0, "悠木碧", 9, 12, 12, "ヒューマン", 43, 15, "サレンディア救護院", "O", "ご奉仕", "お嬢さまのためにがんばるドジっ娘メイド", 102501);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("リン", 144, "test", 0, "小岩井ことり", 11, 1, 1, "獣人族", 42, 17, "牧場（エリザベスパーク）", "B", "あんパン", "遊びと睡眠が何より大事なぐうたら娘", 102601);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("エリコ", 154, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 0, "橋本ちなみ", 13, 7, 30, "魔族", 43, 16, "トワイライトキャラバン", "B", "実験、裁縫、料理", "運命の相手に一途すぎる乙女", 102701);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("サレン", 156, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", 0, "堀江由衣", 9, 10, 4, "エルフ", 43, 17, "サレンディア救護院", "A", "経営、お茶会", "救護院を経営する優しい庶民派お嬢様", 102801);
