INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("シノブ", 157, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 0, "大坪由佳", 7, 12, 22, "魔族", 42, 18, "悪魔偽王国軍（ディアボロス）", "AB", "占い", "占いが得意な霊能少女", 103101);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("アキノ", 157, "この私とともにいる限り、\nお金に不自由はさせませんわ！", 0, "松嵜麗", 12, 3, 12, "ヒューマン", 45, 18, "メルクリウス財団", "AB", "慈善事業", "一人前の商人を目指すパワフルお嬢様", 103201);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("マヒル", 142, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", 0, "新田恵海", 11, 3, 3, "ヒューマン", 35, 20, "牧場（エリザベスパーク）", "B", "漫才", "みんなを笑顔にするお笑い牧場主", 103301);
