INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("トモ", 149, "test", 0, "茅原実里", 8, 8, 11, "ヒューマン", 43, 13, "王宮騎士団（NIGHTMARE）", "A", "剣術、年長者をからかう", "義理堅くてからかい好きな剣術少女", 103701);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("シオリ", 153, "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", 0, "小清水亜美", 11, 11, 3, "獣人族", 40, 14, "牧場（エリザベスパーク）", "A", "読書、お散歩", "読書が趣味の病弱少女", 103801);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("アオイ", 158, "友達ができるその日まで…\nBB団で\nトレーニングですっ！", 0, "花澤香菜", 6, 6, 6, "エルフ", 44, 13, "フォレスティエ", "AB", "友達作りのイメトレ", "「友達」に憧れる、エルフの森の女の子", 104001);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("チカ", 163, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 0, "福原綾香", 4, 6, 3, "ヒューマン", 46, 17, "カルミナ", "O", "各種楽器", "人々を守るために歌う、唱喚士の少女", 104201);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("マコト", 168, "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", 0, "小松未可子", 10, 8, 9, "獣人族", 54, 17, "自警団（カォン）", "O", "お菓子作り", "男勝りで情に厚いワイルド娘", 104301);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("イリヤ", 172, "test", 0, "丹下桜", 7, 5, 5, "魔族", 50, "??", "悪魔偽王国軍（ディアボロス）", "A", "世界征服", "かつては夜を支配した最強の吸血鬼", 104401);
