INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("ジュン", 171, "？？？", 0, "川澄綾子", 8, 10, 25, "ヒューマン", 50, 25, "王宮騎士団（NIGHTMARE）", "A", "格闘技、湯浴み", "素顔を見せない冷静沈着な女性騎士", 104701);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("ミフユ", 163, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 0, "田所あずさ", 12, 11, 11, "ヒューマン", 49, 20, "メルクリウス財団", "O", "傭兵などのアルバイト", "仕事も私事も効率優先な傭兵少女", 104801);
