INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("ミツキ", 166, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", 0, "三石琴乃", 13, 3, 7, "ヒューマン", 53, 27, "トワイライトキャラバン", "A", "研究、実験", "実験が趣味の危険な科学者", 105101);
