INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("モニカ", 140, "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！", 0, "辻あゆみ", 15, 7, 28, "ヒューマン", 33, 18, "ヴァイスフリューゲル　ランドソル支部", "A", "お菓子屋通い", "見た目も中身もお子ちゃまな異国の軍人", 105301);
