INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("タマキ（サマー）", 158, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 0, "沼倉愛美", 12, 3, 1, "獣人族", 48, 18, "メルクリウス財団", "AB", "猫とたわむれること", "弱きを助け強きをくじく猫娘", 107901);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("ミフユ（サマー）", 163, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 0, "田所あずさ", 12, 11, 11, "ヒューマン", 49, 20, "メルクリウス財団", "O", "傭兵などのアルバイト", "仕事も私事も効率優先な傭兵少女", 108001);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("シノブ（ハロウィン）", 157, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 0, "大坪由佳", 7, 12, 22, "魔族", 42, 18, "悪魔偽王国軍（ディアボロス）", "AB", "占い", "占いが得意な霊能少女", 108101);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("ミヤコ（ハロウィン）", 130, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 0, "雨宮天", 7, 1, 23, "魔族", 32, 14, "悪魔偽王国軍（ディアボロス）", "B", "プリンを食べること", "プリン大好きゴースト娘", 108201);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("ミサキ（ハロウィン）", 120, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 0, "久野美咲", 14, 1, 3, "魔族", 22, 11, "ルーセント学院", "A", "ファッション誌鑑賞、コスメ集め", "ちょっとおませな恋に恋する女の子", 108301);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("チカ（クリスマス）", 163, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 0, "福原綾香", 4, 6, 3, "ヒューマン", 46, 17, "カルミナ", "O", "各種楽器", "人々を守るために歌う、唱喚士の少女", 108401);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("クルミ（クリスマス）", 150, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 0, "植田佳奈", 9, 6, 9, "ヒューマン", 40, 12, "サレンディア救護院", "B", "観劇、おままごと", "泣き虫で臆病な守ってあげたい女の子", 108501);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("アヤネ（クリスマス）", 148, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 0, "芹澤優", 9, 5, 10, "ヒューマン", 38, 14, "サレンディア救護院", "B", "屋内でできる遊び", "ぷうきちといつも一緒！", 108601);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("ヒヨリ（ニューイヤー）", 155, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 0, "東山奈央", 2, 8, 27, "獣人族", 44, 16, "トゥインクルウィッシュ", "A", "人助け、応援", "人助けが大好き！　前向き格闘娘", 108701);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("ユイ（ニューイヤー）", 158, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 0, "種田梨沙", 2, 4, 5, "ヒューマン", 47, 17, "トゥインクルウィッシュ", "O", "料理、人間観察", "戦闘のサポートが得意な、心優しい少女", 108801);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("レイ（ニューイヤー）", 163, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 0, "早見沙織", 2, 1, 12, "魔族", 46, 18, "トゥインクルウィッシュ", "B", "読書、乗馬、お茶", "クールで何事にも真っ直ぐな剣士", 108901);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("エリコ（バレンタイン）", 154, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 0, "橋本ちなみ", 13, 7, 30, "魔族", 43, 16, "トワイライトキャラバン", "B", "実験、裁縫、料理", "運命の相手に一途すぎる乙女", 109001);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("シズル（バレンタイン）", 168, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 0, "生天目仁美", 3, 10, 24, "ヒューマン", 54, 18, "ラビリンス", "O", "家事全般", "お姉ちゃんがお世話してあげるからねっ！", 109101);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("アン", 156, "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", 0, "日笠陽子", "", 12, 1, "ヒューマン", 55, 17, "？？？", "AB", "読書", "英霊と契約を結んだマナリアの天才王女", 109201);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("ルゥ", 144, "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", 0, "こやまきみこ", "", 2, 4, "ヒューマン", 45, 15, "？？？", "O", "食べること、眠ること", "マナリア魔法学院の新入生", 109301);
